(5, 1, 2, 'Budget Suite', '400', -2, 0, 30, 0, 'Private%20suite.%20En-suite%20bathroom%20with%20shower.%20Secure%20off-street%20parking.%20%20100%25%20cotton%20linen.%20Fully%20equipped%20kitchenette%20(no%20stove)%2C%20high-speed%20WiFi%20100%20Mbps%2C%20Enjoy%20Netflix.%0A%0ASpeechless%20is%20what%20you%E2%80%99ll%20be%20when%20you%20enter%20this%20lovely%20suite.%0A%0A%7BThe%20Space%7D%0A%0AThis%20bedroom%20has%20been%20designed%20for%20comfort%20and%20space.%0A%0AIt%20has%20a%20sleeping%20and%20sitting%20area%20with%20a%20comfortable%20Coricraft%202-seater%20couch.%0A%0AThis%20bedroom%20is%20inviting%20and%20peaceful%2C%20exiting%20through%20the%20French%20doors.%0A%0AThe%20suite%20is%20ideally%20located%20on%20the%20ground%20floor.%0A%0A%0A%7BThe%20Bathroom%7D%0A%0ARest%20assured%20that%20you%20and%20your%20loved%20ones%20will%20have%20your%20own%20clean%20private%20bathroom.%20You%20will%20also%20get%20multiple%20luxury%20towels%20to%20make%20sure%20your%20stay%20with%20us%20is%20comfortable.%0A%0AThis%20bedroom%20boasts%20an%20ensuite%20bathroom%20with%20a%20shower.%0A%0A%0A%7BThe%20Kitchen%7D%0A%0AThe%20private%20kitchenette%20is%20fitted%20with%20all%20the%20amenities%20that%20you%20could%20need.%20There%20is%20a%20microwave%2C%20fridge%2C%20kettle%20and%20many%20more.%20Unfortunately%2C%20there%20is%20no%20stove%20in%20this%20unit', 3, 1, '2023-01-26 08:45:38', '2023-01-26 08:06:39'),
(6, 1, 1, 'Upstairs+King+Room', '500', 2, 0, 50, 1, 'Private%25202-sleeper%2520suite%2520in%2520a%2520guesthouse%2520with%2520private%2520entrance.%2520Private%2520bathroom%2520with%2520shower.%2520Sitting%2520area%2520with%2520working%2520space%2520and%2520a%2520desk.%2520Secure%2520off-street%2520parking.%2520100%2525%2520cotton%2520linen.%2520Fully%2520equipped%2520kitchenette%2520(No%2520Stove)%252C%2520high-speed%2520WiFi%2520100mbps%252C%2520Enjoy%2520Netflix.%250A%250A%2520Speechless%2520is%2520what%2520you%25E2%2580%2599ll%2520be%2520when%2520you%2520enter%2520this%2520lovely%2520suite.%250A%250A%257BThe%2520space%257D%250AThis%2520suite%2520is%2520designed%2520for%2520comfort%2520and%2520space.%2520It%2520has%2520a%2520sleeping%2520area%2520and%2520a%2520working%2520area%2520with%25202%2520occasional%2520couches%2520and%2520a%2520desk%250A%250AThe%2520suite%2520has%2520plenty%2520of%2520shelves%2520and%2520wardrobe%2520space.%2520Trust%2520me%252C%2520you%2520won%25E2%2580%2599t%2520run%2520out%2520of%2520extra%2520space%2520to%2520keep%2520your%2520luggage.%250A%250AThis%2520Upstairs%2520suite%2520is%2520inviting%2520and%2520peaceful%252C%2520exit%2520through%2520the%2520French%2520doors%2520to%2520the%2520balcony%2520for%2520fresh%2520air.%250A%250AThe%2520bedroom%2520is%2520ideally%2520located%2520on%2520the%2520upstairs%2520floor.%2520Have%2520the%2520whole%2520floor%2520to%2520yourself.%250A%250A%257BThe%2520Bathroom%257D%250A%250ARest%2520assured%2520that%2520you%2520and%2520your%2520loved%2520ones%2520will%2520have%2520your%2520own%2520clean%2520private%2520bathroom.%2520You%2520will%2520also%2520get%2520multiple%2520luxury%2520towels%2520to%2520make%2520sure%2520your%2520stay%2520with%2520us%2520is%2520comfortable.%250A%250AThis%2520bedroom%2520boasts%2520an%2520ensuite%2520bathroom%2520with%2520a%2520super%2520large%2520shower%2520for%2520those%2520quick%2520shower%2520mornings.%250A%250A%257BPrivate%2520balcony%257D%250A%250AThe%2520bedroom%2520has%2520french%2520doors%2520leading%2520to%2520your%2520private%2520balcony%2520with%2520a%2520view%2520of%2520the%2520swimming%2520pool%2520and%2520Johannesburg%2520east.%250A%250AGuests%2520will%2520also%2520have%2520access%2520to%2520the%2520lounge%2520and%2520the%2520dining%2520room%2520and%2520our%2520lovely%2520garden.%2520The%2520dining%2520area%2520leads%2520to%2520a%2520beautiful%2520FRENCH%2520STYLE%2520COUNTRY%2520kitchen.%2520The%2520connoisseur%25E2%2580%2599s%2520delight.%250A%250A%257BThe%2520Kitchen%257D%250A%250Athe%2520private%2520kitchenette%2520is%2520fitted%2520with%2520all%2520the%2520amenities%2520that%2520you%2520could%2520need.%2520There%2520is%2520a%2520microwave%252C%2520fridge%252C%2520toaster%252C%2520kettle%2520and%2520many%2520more.%2520Unfortunately%252C%2520there%2520is%2520no%2520stove%2520in%2520this%2520unit', 3, 1, '2023-01-26 08:16:44', '2023-01-26 08:05:56'),
(7, 1, 2, 'Queen Suite', '500', 2, 0, 30, 0, 'Private%20queen%20suite%20with%20private%20entrance.%20Private%20massive%20bathroom%20with%20walk-in%20shower.%20Secure%20off-street%20parking.%20Russell%20Hobs%20Mist%20Fan%20for%20those%20hot%20summer%20days%2C%20100%25%20cotton%20linen.%20Fully%20equipped%20Private%20Kitchenette%20(no%20stove)%2C%20high-speed%20WiFi%20100mbps%2C%20Enjoy%20Netflix.%0A%0ASpeechless%20is%20what%20you%E2%80%99ll%20be%20when%20you%20enter%20this%20lovely%20suite.%0A%0A%7BThe%20Space%7D%0A%0AThis%20suite%20has%20been%20designed%20for%20comfort%20and%20space.%0A%0AIt%20has%20plenty%20of%20shelves%20and%20luggage%20space.%20This%20is%20a%20mini%20apartment%2C%20%20The%20bedroom%20is%20separate%20from%20the%20dining%20area%20and%20kitchen%0A%0A%7BThe%20Bathroom%7D%0A%0ARest%20assured%20that%20you%20and%20your%20loved%20ones%20will%20have%20your%20own%20clean%20private%20bathroom.%20You%20will%20also%20get%20multiple%20luxury%20towels%20to%20make%20sure%20your%20stay%20with%20us%20is%20comfortable.%0A%0AThis%20suite%20boasts%20a%20spacious%20ensuite%20bathroom%20with%20a%20walk-in%20shower%0A%0A%0A%7BThe%20Kitchen%7D%0A%0AThe%20private%20kitchenette%20is%20fitted%20with%20all%20the%20amenities%20that%20you%20could%20need.%20There%20is%20a%20microwave%2C%20fridge%2C%20toaster%2C%20kettle%20and%20many%20more.%20Unfortunately%2C%20there%20is%20no%20stove%20in%20this%20suite', 3, 1, '2023-01-25 15:47:03', '2023-01-26 08:04:50'),
(8, 2, 1, '4-Sleeper Upstairs Family Room', '550', 4, 0, 50, 1, 'Private 4-sleeper family suite in a guesthouse. parents’ room private, kids’ room open plan wt 2 single beds. Private bathroom with shower. Secure off-street parking and personal gate remote to keep during your stay. 100% cotton linen. Fully equipped kitchen with gas cooker & convection oven, Coffee maker, high-speed WiFi 50mbps, Enjoy Netflix.\n\n Speechless is what you’ll be when you enter this lovely guesthouse.\n\nNote: Due to hygiene concerns and misuse of towels, we no longer offer towels.\n\nThe space\nBedroom\n\nThis family suite has been designed for comfort and space. it has enough room for a family of four. The parents have their own room with a door and lock. There is also a desk and chair in the parents’ room.\n\nThe kids’ room is open plan and does not have a door. The kid’s room has 2 single beds, a couch and a smart tv with Netflix.\n\nThe suite has plenty of shelves and multiple closets. Trust me, you won’t run out of extra space to keep your luggage.\n\nThis Upstairs suite is inviting and peaceful, exit through the French doors to the balcony with a view.\n\nThe bedroom is perfectly located on the upstairs floor. Have the whole floor to yourself.\n\nThe Bathroom\n\nRest assured that you and your loved ones will have your own clean private bathroom. You will also get multiple luxury towels to make sure your stay with us is comfortable.\n\nThis bedroom boasts an ensuite bathroom with a super large shower for those quick shower mornings.\n\nThe bathroom is accessed through the kids’ bedroom.\n\n\nPrivate balcony\n\nThe bedroom has french doors leading to your private balcony with a view of the swimming pool and Johannesburg east.\n\nGuests will also have access to the lounge and the dining room and our lovely garden. The dining area leads to a beautiful FRENCH STYLE COUNTRY kitchen. The connoisseur’s delight.\n\n The Kitchen\n\nYou will have access to the fully equipped kitchen. Please do feel free to cook up a storm on our five-plate gas stove. The kitchen is equipped with a toaster, electric kettle, Microwave, and Oven for roasting and baking.\n\nIt is a shared kitchen and we do ask that after making that Jamie Oliver cuisine, you clean up after yourself to leave it clean and spotless.', 3, 1, '2023-01-23 06:44:55', '2023-01-26 07:26:36'),
(9, 1, 1, 'King Studio', '500', 2, 0, 32, 0, 'Private Extra large suite. En-suite bathroom with walk-in shower. Secure off-street parking.  100% cotton linen. Fully equipped kitchenette (no stove), high-speed WiFi 100 Mbps, Enjoy Netflix.\n\nSpeechless is what you’ll be when you enter this lovely suite.\n\n{The Space}\n\nThis bedroom has been designed for comfort and space.\n\nIt has plenty of shelves and multiple closets. Trust me, you won’t run out of extra space to keep your luggage. This is a double Bedroom, it has a sleeping area and a sitting area with a desk and a comfortable Coricraft 2 seater couch.\n\nThis master bedroom is inviting and peaceful, exiting through the French doors to the outdoor patio.\n\nThe suite is perfectly located on the ground floor.\n\n\n{The Bathroom}\n\nRest assured that you and your loved ones will have your own clean private bathroom. You will also get multiple luxury towels to make sure your stay with us is comfortable.\n\nThis bedroom boasts a spacious ensuite bathroom with a walk-in shower.\n\n{Private Patio}\n\nThe bedroom has french doors leading to your private patio. Have breakfast and coffee on the patio\n\n\n{The Kitchen}\n\nThe private kitchenette is fitted with all the amenities that you could need. There is a microwave, fridge, kettle and many more. Unfortunately, there is no stove in this unit', 3, 1, '2023-01-25 15:47:43', '2023-01-26 08:06:50'),
(10, 1, 2, 'One Bedroom Loft', '500', 2, 0, 40, 1, 'Private 1-bedroom loft with private entrance. A bathroom with a shower. Secure off-street parking. Fully equipped private kitchen with a stove (no Oven), high-speed WiFi 100mbps, Enjoy Netflix. Private patio.\n\nDining area and kitchenette downstairs with the bedroom and sitting area upstairs.\n\n{The Bedroom}\n\nThe bedroom is upstairs and very cosy.\n\nIt has a built-in wardrobe and queen size bed with a smart TV mounted on the wall.\n \n{The Bathroom}\n\nRest assured that you and your loved ones will have your own clean private bathroom. You will also get multiple luxury towels to make sure your stay with us is comfortable.\n\nThis family unit has one bathroom with a shower.\n\n{Private Patio}\n\nThe unit has french doors leading to your private patio. Have breakfast and coffee on the patio with your family and friends\n\n{The Kitchen}\n\nthe kitchen is fitted with all the amenities that you could need. There is a microwave, fridge, toaster, kettle and many more.', 3, 1, '2023-01-25 15:47:14', '2023-01-26 08:12:47'),
(11, 1, 1, 'King Studio With Stove', '500', 2, 0, 30, 0, 'Private Extra large cottage. En-suite bathroom with shower. Secure off-street parking.  100% cotton linen. Fully equipped kitchenette with stove, high-speed WiFi 100 Mbps, Enjoy Netflix.\n\nSpeechless is what you’ll be when you enter this lovely cottage.\n\n{The Space}\n\nThis bedroom has been designed for comfort and space.\n\nIt has plenty of wardrobe space. This cottage has a sleeping area and a sitting area with a dining room table and a comfortable Coricraft 2-seater couch.\n\nThis cottage is inviting and peaceful, exiting through the French doors to the outdoor patio.\n\nThe suite is perfectly located on the ground floor.\n\n{The Bathroom}\n\nRest assured that you and your loved ones will have your own clean private bathroom. You will also get multiple luxury towels to make sure your stay with us is comfortable.\n\nThis bedroom boasts a spacious ensuite bathroom with a walk-in shower.\n\n{Private Patio}\n\nThe bedroom has french doors leading to your private patio. Have breakfast and coffee on the patio\n\n\n{The Kitchen}\n\nThe private kitchenette is fitted with all the amenities that you could need. There is a microwave, fridge, kettle, stove and many more.', 3, 1, '2023-01-26 08:46:27', '2023-01-26 09:13:38'),
(13, 1, 2, 'One Bedroom Suite', '500', 2, 0, 36, 0, 'Private Extra large one-bedroom cottage. En-suite bathroom with shower. Secure off-street parking.  100% cotton linen. Fully equipped kitchenette with stove, high-speed WiFi 100 Mbps, Enjoy Netflix.\n\nSpeechless is what you’ll be when you enter this lovely suite.\n\n{The Space}\n\nThis bedroom has been designed for comfort and space.\n\nIt has plenty of wardrobe space. This suite has a sleeping area and a sitting area with a dining room table and a comfortable 2-seater couch.\n\nThis cottage is inviting and peaceful.\n\nThe suite is perfectly located on the ground floor.\n\n{The Bathroom}\n\nRest assured that you and your loved ones will have your own clean private bathroom. You will also get multiple luxury towels to make sure your stay with us is comfortable.\n\nThis bedroom boasts a spacious ensuite bathroom with a walk-in shower.\n\n\n{The Kitchen}\n\nThe private kitchen is fitted with all the amenities that you could need. There is a microwave, fridge, kettle, stove and many more.', 3, 1, '2023-01-26 00:35:34', '2023-01-26 08:09:43'),
(14, 1, 2, 'One Bedroom Suite G II', '500', 2, 0, 36, 0, 'Private Extra large one-bedroom cottage. En-suite bathroom with shower. Secure off-street parking.  100% cotton linen. Fully equipped kitchenette with stove, high-speed WiFi 100 Mbps, Enjoy Netflix.\n\nSpeechless is what you’ll be when you enter this lovely suite.\n\n{The Space}\n\nThis bedroom has been designed for comfort and space.\n\nIt has plenty of wardrobe space. This suite has a sleeping area and a sitting area with a dining room table and a comfortable 2-seater couch.\n\nThis cottage is inviting and peaceful.\n\nThe suite is perfectly located on the ground floor.\n\n{The Bathroom}\n\nRest assured that you and your loved ones will have your own clean private bathroom. You will also get multiple luxury towels to make sure your stay with us is comfortable.\n\nThis bedroom boasts a spacious ensuite bathroom with a walk-in shower.\n\n\n{The Kitchen}\n\nThe private kitchen is fitted with all the amenities that you could need. There is a microwave, fridge, kettle, stove and many more.', 3, 1, '2023-01-26 04:47:38', '2023-01-26 09:09:03');
